import { slide as Menu } from 'react-burger-menu'
import "./side_bar.css"

const Side_Bar = () => {
    return(
        <Menu>
            <a id="home" className="sidebar-item" href="/">Home</a>
            <a id="about" className="sidebar-item" href="/">about</a>
        </Menu>
    )
};
export default Side_Bar;
